INSERT INTO [dbo].[Fish] ([FishId], [Type], [TankSize], [Name], [ScientificName], [Details], [Photo], [UploadedBy], [UploadedOn], [Price], [Size], [FishSize], [CommentId], [Likes], [DisLikes], [Views], [SoldOut], [FishAvailable], [FishAvailableFrom]) VALUES (13, 14, 0, N'Foxface fish', N'Siganus vulpinus', N'The Foxface Lo, also known as the Foxface Rabbitfish, has a very unique body color. It has a mottled yellow-brown body with a dark chest. The face is very light in color and speckled on the lower half.  They are a very hardy fish, and are great additions to the newly-established tank. It may reside in a 200 litre or larger aquarium. It is a very peaceful species except when housed with other rabbitfish. The Foxface Lo may be housed with more aggressive fish.  Its predators will tend to leave it alone because of its venomous dorsal spines. Rabbitfish are generally reef-safe if they are well fed. If not, it is possible for them to nip at and consume some species of LPS and soft corals.  The Foxface Lo diet consists of a variety of fresh vegetables and undesirable species of algae. It does nip and possibly eat some soft and hard coral polyps.', <SQLVARIANT>, NULL, NULL, N'65', NULL, NULL, NULL, 0, 0, 4, 0, 0, NULL)
